import logo from './logo.svg';
import './App.css';

import { Route, Link, BrowserRouter as Router } from 'react-router-dom'
import Home from './Pages/Home'

const Routing = (
    <Router>
        <div>
            <Router path="/" component={App} />
            <Router path="/home" component={Home} />
        </div>
    </Router>
)


function App() {
  return (
    <Router>
    <div>
      <Header />
      <Container />
    </div>
  </Router>
  );
}

export default App;
